import React from 'react';

import './App.css';
import {tweets} from '../../constants';
import Tweet from '../../components/Tweet';


console.log(tweets);
const App = () => (
    <div id = "main">
    tweets.map((tweet, index) =>
            
            <Tweet
                key = {index}
                avatar =  {tweet.avatar}
                fullname = {tweet.fullname}
                date = {tweet.date}
                content = {tweet.content} 

            
            />

        )
        </div>


    
);

export default App;
